            title: "Title 1",
            thumbnail: "placeholder.png"
        },
        {
            id:1,
            discountedPrice: 200,
            price: 310,
            title: "Title 2",
            thumbnail: "placeholder.png"
        },
        {
            id:2,
            discountedPrice: 100,
            price: 120,
            title: "Title 3",
            thumbnail: "placeholder.png"
        }
    ]
    return (
        <div className={"product-list"}>
            <div className={"product-list--wrapper"}>

                <ListItem data={items[0]}></ListItem>

                <ListItem data={items[1]}>
                </ListItem>

                <ListItem data={items[2]}>
                </ListItem>
            </div>
        </div>
    )

}
export default Products;
